import React from 'react';
import Header from './components/Header';
import Footer from './components/Footer';
import BitcoinPriceTracker from './components/BitcoinPriceTracker';
import 'bootstrap/dist/css/bootstrap.min.css';
import './index.css';
import roadImage from './road.png'; // Import the image

const TopSection = () => {
  return (
    <div className="top-section">
      <div className="top-section-content"></div>
      <img src={roadImage} alt="Road" className="top-section-img" />
    </div>
  );
};

const App = () => {
  return (
    <>
      <Header />
      <main className="container mt-5">
      <TopSection />
        <BitcoinPriceTracker />
      </main>
      <Footer />
    </>
  );
};

export default App;
